import '../css/Addmodal.css';

function Addmodal() {
  return (
    <div className='Addmodal'>
      <h1>메뉴 추가</h1>
      <p>이름<input></input></p>
      <p>가격<input></input></p>
      <p>상품 이미지<input></input></p>
    </div>

      

  );
}

export default Addmodal;
